!(function() {
	for (
		var e,
			t = [
				"assert",
				"clear",
				"count",
				"debug",
				"dir",
				"dirxml",
				"error",
				"exception",
				"group",
				"groupCollapsed",
				"groupEnd",
				"info",
				"log",
				"markTimeline",
				"profile",
				"profileEnd",
				"table",
				"time",
				"timeEnd",
				"timeline",
				"timelineEnd",
				"timeStamp",
				"trace",
				"warn"
			],
			n = t.length,
			o = (window.console = window.console || {});
		n--;

	)
		o[(e = t[n])] || (o[e] = function() {});
})(),
	$('a[href*="#"]')
		.not('[href="#"]')
		.not('[href="#0"]')
		.click(function(e) {
			if (
				location.pathname.replace(/^\//, "") ==
					this.pathname.replace(/^\//, "") &&
				location.hostname == this.hostname
			) {
				var t = $(this.hash);
				(t = t.length ? t : $("[name=" + this.hash.slice(1) + "]"))
					.length &&
					(e.preventDefault(),
					$("html, body").animate(
						{ scrollTop: t.offset().top },
						1e3,
						function() {
							var e = $(t);
							if ((e.focus(), e.is(":focus"))) return !1;
							e.attr("tabindex", "-1"), e.focus();
						}
					));
			}
		});
$(function() {
	$("#body").addClass("animation");
	$("#menu-toggle").click(function() {
		$("#menu-wrap").fadeToggle("1000", "linear");
	});
	if($(window).width() <= 720){
		$("#menu a").click(function() {
			$("#menu-wrap").fadeToggle("1000", "linear");
		});
	}
	$('#page-right').css({ height: $(window).height() });
	new WOW().init();
});
